    false,nt"url": null,nt"notes": "The ENSO Diagnostics Discussion (EDD) is
    issued by NOAA Climate Prediction Center each month on the Thursday between the
    5th and 11th with few exceptions (major holiday). The discussion provides information
    on the current and future status of ENSO, describes the current oceanic and atmospheric
    conditions in the Pacific, and gives information on related climate impacts over
    the United States and other regions. More specifically, the discussion includes
    analyses of surface and subsurface ocean temperatures, rainfall, outgoing longwave
    radiation, and low-level and upper-level winds over the equatorial Pacific Ocean.
    Along with current observations, predictions from statistical and dynamical models
    are also provided. The EDD is provided in HTML, PDF, and Microsoft Word document
    formats, and a Spanish version is provided along with an English version. The EDD
    is designed for use by scientists, decision makers, and for members of the general
    public.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
